import styled from "styled-components";

export const Container = styled.header`
    max-width: 100%fit-content;
    align-items: center;
    padding: 142px 65px 100px;
    display: flex;
    justify-content: center;
    min-height: 50px !important;
    max-height: 150px;
    position: relative;
`;

export const Content = styled.div`
    position: absolute;
    margin-left: 0;
`;
